$(`<center><div style="position: static;width: 100%;" onclick="setTimeout(function(){fixSize();},800);"><div width="99.5%" id="design-a"style="background-color: antiquewhite;color: #105873;border-bottom: 3px solid #105873;border-top: 3px solid #6b5f5f;padding-bottom: 2px;border-radius: 0px 0px 15px 15px;" ><font id="sultan" class=" sultan11"><u><b>قوانين الشات</b></u> </font><div id="spanan" style="font-family: jazeera-light, FontAwesome;color: red;text-align: right;display:none;" ><p style="text-align: center"><b><font color="#000080">قوانين شات سهر الشام</font></b></p></p><div style="float: right;padding-right: 20px;">- 1</div> يمنع منعا باتا غلط اداري او سوبر على عضو ومن يخالف القوانين سيتم تنزيل رتبته <img src="https://sahr0.net/sico/1604252184298.gif"></p><div style="float: right;padding-right: 20px;">- 2</div>   عزيزي المسؤول عندما يتم شتمك من طرف الاعضاء وترد الشتم بالشتم وتقوم بحظر العضو , سيتم  تنزيل رتبتك <img src="https://sahr0.net/sico/1604252184298.gif"></p><div style="float: right;padding-right: 20px;">- 3</div> عندما تصبح مشكلة بين المسؤولين والطرف الاعلى يشتم الثاني , سيتم عكس الرتب ورفع الطرف لثاني <img src="https://sahr0.net/sico/1604252184298.gif"> </p><div style="float: right;padding-right: 20px;">- 4</div> كل من لديه شكوى يجيب عليه احضار سكرين يوثق الذي حدث <img src="https://sahr0.net/sico/1604252184298.gif"></p><div style="float: right;padding-right: 20px;">- 5</div> يمنع منعا باتا التنزيل دون سبب , ومن يخالف القوانين سيتم تخفيض رتبته<img src="https://sahr0.net/sico/1604252184298.gif"></p><div style="float: right;padding-right: 20px;">- 6</div>عزيزي المسؤول عندما تحصل مشكلة بينك وبين مسؤول اخر ؛ عليك أنتظار صاحب الموقع دون غلط  وأما سيتم التخفيض من رتبكم<img src="https://sahr0.net/sico/1604252184298.gif"><p><b>كل من يخالف القوانين  سيتم معاقبته </font></b><p style="text-align: center"><u><b><a target="_blank" href="">لا تتردد في ارسال شكوتك , مع تحيات صاحب الموقع </a></b></u></font></div> </div></div><center>`).insertBefore('#d2');$("#design-a").click(function(){$("#spanan").slideToggle(function(){});});





